// App.jsx - Updated with File Structure Routes
import React from 'react';
import { BrowserRouter, Routes, Route, Link, useLocation, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './utils/auth';

// Import components from your file structure
import Home from './pages/student/Home';
import Login from './pages/Login';
import Register from './pages/Register';

// Student Pages
import StudentAttendance from './pages/student/Attendance';
import StudentMonitoring from './pages/student/Monitoring';
import StudentRating from './pages/student/Rating';
import StudentCourses from './pages/student/Courses';
import StudentFeedback from './pages/student/Feedback';

// Lecturer Pages
import LecturerClasses from './pages/lecturer/Classes';
import LecturerMonitoring from './pages/lecturer/Monitoring';
import LecturerRating from './pages/lecturer/Rating';

// PL Pages
import PLCourses from './pages/pl/Courses';
import PLLecturerAssigned from './pages/pl/LecturerAssigned';

// PRL Pages
import PRLClasses from './pages/prl/Classes';
import PRLCourses from './pages/prl/Courses';
import PRLMonitoring from './pages/prl/Monitoring';
import PRLReports from './pages/prl/Reports';

// Keep your existing Navigation, PrivateRoute, PublicRoute, NotFound, and Footer components exactly as they are...

// Main App Content with Updated File Structure Routing
function AppContent() {
  return (
    <div className="min-vh-100 bg-light">
      <Navigation />

      <main className="container-fluid px-0">
        <Routes>
          {/* Public Route - Accessible to all */}
          <Route path="/" element={<Home />} />

          {/* Public Routes - Only accessible when NOT logged in */}
          <Route 
            path="/login" 
            element={
              <PublicRoute>
                <Login />
              </PublicRoute>
            } 
          />
          <Route 
            path="/register" 
            element={
              <PublicRoute>
                <Register />
              </PublicRoute>
            } 
          />

          {/* Student Routes */}
          <Route
            path="/attendance"
            element={
              <PrivateRoute roles={['Student']}>
                <StudentAttendance />
              </PrivateRoute>
            }
          />

          <Route
            path="/monitoring"
            element={
              <PrivateRoute roles={['Student']}>
                <StudentMonitoring />
              </PrivateRoute>
            }
          />

          <Route
            path="/rating"
            element={
              <PrivateRoute roles={['Student']}>
                <StudentRating />
              </PrivateRoute>
            }
          />

          <Route
            path="/courses"
            element={
              <PrivateRoute roles={['Student']}>
                <StudentCourses />
              </PrivateRoute>
            }
          />

          <Route
            path="/feedback"
            element={
              <PrivateRoute roles={['Student']}>
                <StudentFeedback />
              </PrivateRoute>
            }
          />

          {/* Lecturer Routes */}
          <Route
            path="/lecturer/classes"
            element={
              <PrivateRoute roles={['Lecturer']}>
                <LecturerClasses />
              </PrivateRoute>
            }
          />

          <Route
            path="/lecturer/monitoring"
            element={
              <PrivateRoute roles={['Lecturer']}>
                <LecturerMonitoring />
              </PrivateRoute>
            }
          />

          <Route
            path="/lecturer/rating"
            element={
              <PrivateRoute roles={['Lecturer']}>
                <LecturerRating />
              </PrivateRoute>
            }
          />

          {/* PL Routes */}
          <Route
            path="/pl/courses"
            element={
              <PrivateRoute roles={['PL']}>
                <PLCourses />
              </PrivateRoute>
            }
          />

          <Route
            path="/pl/lecturer-assigned"
            element={
              <PrivateRoute roles={['PL']}>
                <PLLecturerAssigned />
              </PrivateRoute>
            }
          />

          {/* PRL Routes */}
          <Route
            path="/prl/classes"
            element={
              <PrivateRoute roles={['PRL']}>
                <PRLClasses />
              </PrivateRoute>
            }
          />

          <Route
            path="/prl/courses"
            element={
              <PrivateRoute roles={['PRL']}>
                <PRLCourses />
              </PrivateRoute>
            }
          />

          <Route
            path="/prl/monitoring"
            element={
              <PrivateRoute roles={['PRL']}>
                <PRLMonitoring />
              </PrivateRoute>
            }
          />

          <Route
            path="/prl/reports"
            element={
              <PrivateRoute roles={['PRL']}>
                <PRLReports />
              </PrivateRoute>
            }
          />

          {/* Catch all route - 404 */}
          <Route path="*" element={<NotFound />} />
        </Routes>
      </main>

      <Footer />
    </div>
  );
}

// Main App Export
export default function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <AppContent />
      </BrowserRouter>
    </AuthProvider>
  );
}
